import React from 'react';
import ProjectCard from './ProjectCard';

const Projects = () => {
    return (
       <div style={styles.container} >
            <ProjectCard name="places2be" photoUrl="" description="Hi" />

       </div>
    );
};

const styles = {
    container: {
        backgroundColor: '#e0e0dc',
        flex: '100%',
        paddingLeft: '50px',
        paddingRight: '50px',
        paddingBottom: '50px',
    }
}

export default Projects;
